The '''ANF Les Mureaux 190''' was a [[France|French]] prototype light [[fighter aircraft]]. In response to a program created by the French Minister of Air, the ANF Les Mureaux 190 was designed by André Brunet as a light fighter. The ANF Les Mureaux 190 was an all-metal [[monoplane]], and was first tested in July 1936, then taken to the 15th [[Paris Air Show]] in late November,<ref>Institute of the Aeronautical Sciences, 1937. ''Journal of the Aeronautical Sciences'', Volume 4, [https://books.google.com/books?ei=87hZTfu1O4HAtgfZh72cDQ&ct=result&id=MT1YAAAAMAAJ&dq=ANF+Les+Mureaux+190&q=%22Mureaux+190%22#search_anchor p.170].</ref> where it was asserted to be very manoeuvrable. However, less than a year later, the project was abandoned due to the poor quality of its engine.
The ANF Les Mureax 190 was powered by a 450&nbsp;hp [[Salmson 12 Vars]] [[V12 engine|inverted V-12]] engine. its proposed armament consisted of a {{convert|20|mm|abbr=on}} engine-mounted [[cannon]], and two 7.7mm (.30-caliber) wing-mounted [[machine gun]]s.<ref>{{cite book|title=The complete book of fighters: an illustrated encyclopedia of every fighter aircraft built and flown|year=2001|publisher=Salamander|isbn=978-1-84065-269-7|author=Green, William|author2=Gordon Swanborough|page=19}}</ref>
